 const getCurrenceRecipesFoodsIngredients = () => {
    const ingredients = `https://www.themealdb.com/api/json/v1/1/filter.php?i=lime`
   return fetch(ingredients)
    .then((response) => (
        response.json()
        .then((json) => (response.ok ? Promise.resolve(json) : Promise.reject(json)))
    ))
}

export default getCurrenceRecipesFoodsIngredients;
